import React, { Component } from 'react';
import './style.css'

class counter extends Component {
    state = { 
        tags:["Tag1" , "Tag2" , "Tag3" , "Tag4" , "Tag5"]
     }
     renderTags(){
        if(this.state.tags === 0) return <p>this array</p>
     }
    render() { 
        return (
            <React.Fragment>
                <ul> {this.state.tags.map(tag=><li>{tag}</li>)} </ul>
            </React.Fragment>
        );
    }
}
 
export default counter;
